const Product = ({ product }) => {
  return (
    <div key={product.id} style={{width: '80%', padding: '5px', border: '1px solid black', marginBottom: '10px', textAlign: 'left', flexDirection: 'row', flex: 1}}>
      <img src={product.image.src} style={{width: '10%', height: '10%'}} />
      <p>{product.title}</p>
      <p>{product.title}</p>
    </div>
  )
}

export default Product
